// App.tsx
import React from 'react';
  import { NavigationContainer } from '@react-navigation/native';
import AppNavigator from './src/screen/AppNavigator';

const App: React.FC = () => {
  return (
    <NavigationContainer>
      <AppNavigator />
    </NavigationContainer>
  );
};

export default App;
